# (FPCore
#  (x y)
#  :name
#  "i4"
#  :description
#  "Generated by FPTaylor"
#  :precision
#  binary32
#  :pre
#  (and (<= 1/10 x 10) (<= -5 y 5))
#  (sqrt (+ x (* y y)))

using IntervalArithmetic
using DataStructure
using BenchTest

y = DataVariable("y","real",@interval(-Inf,+Inf))
x1 = DataVariable("x1","real",@interval(1/10,10))
x2 = DataVariable("x2","real",@interval(-5,5))
eps = DataConstant("eps","real",10^-10)

variables = [y, x1, x2]
constants = []

C = DataConstraint("C_i4",
                   constants,
                   variables,
                   "=",
                   y,
                   DataUnaryOperation("sqrt",
                                      DataBinaryOperation("+",
                                                          x1,
                                                          DataBinaryOperation("*",
                                                                              x2,
                                                                              x2))),
                   eps)

test(C, variables, constants, ARGS)
